import React, { useCallback, useState } from 'react'

import { useQueryClient } from 'react-query'

import { Box, InputAdornment, InputBase, Typography } from '@mui/material'
import { styled } from '@mui/material/styles';
import { DataGrid } from '@mui/x-data-grid'
import SearchIcon from '@mui/icons-material/Search'
import { Search } from '../../components'

import debounce from 'lodash.debounce'

const StyledDataGrid = styled(DataGrid)(({ theme }) => ({
  border: 0,
  '& .MuiDataGrid-dataContainer': {
    minHeight: '100%!important'
  },
  '& .MuiDataGrid-viewport': {
    overflow: 'initial'
  },
  '& .MuiDataGrid-renderingZone': {
    transform: 'none!important'
  },
  '& .MuiDataGrid-columnsContainer': {
    minHeight: '40px !important',
    maxHeight: '40px !important',
    lineHeight: '40px !important',
    borderBottom: '1px solid #33403F'
  },
  '& .MuiDataGrid-window': {
    top: '40px !important'
  },
  '& .MuiDataGrid-columnCell': {
    padding: '0px 8px'
  },
  '& .MuiDataGrid-columnHeader:focus': {
    outline: 'none'
  },
  '& .MuiDataGrid-columnHeader:focus-within': {
    outline: 'none'
  },
  '& .MuiDataGrid-columnHeaderTitle': {
    fontSize: '18px',
    fontWeight: 600
  },
  '& .MuiDataGrid-columnHeaderTitleContainer': {
    minHeight: '40px',
    padding: 0
  },
  '& .MuiDataGrid-columnSeparator': {
    display: 'none'
  },
  '& .MuiDataGrid-cell': {
    fontWeight: 500,
    fontSize: '1rem',
    lineHeight: 'initial !important',
    whiteSpace: 'normal',
    display: 'flex',
    alignItems: 'center',
    height: 'auto',
    minHeight: '35px !important',
    padding: '5px 10px'
  },
  '& .MuiDataGrid-cellCenter': {
    justifyContent: 'center'
  },
  '& .MuiDataGrid-colCell:focus': {
    outline: 'none'
  },
  '& .MuiDataGrid-cell:focus': {
    outline: 'none'
  },
  '& .MuiDataGrid-cell:focus-within': {
    outline: 'none'
  },
  '& .MuiDataGrid-footer': {
    justifyContent: 'flex-start'
  },
  '& .MuiDataGrid-row': {
    maxHeight: '140px !important',
    minHeight: '35px !important'
  }
}));

export default function Tracks () {
  // const queryClient = useQueryClient()
  // const queryName = 'trackData'

  const [search, setSearch] = useState('')

  // const refetch = () => queryClient.invalidateQueries(queryName)
  // const debouncedTrackSearch = useCallback(debounce(refetch, 400), [])
  const handleTrackSearch = (event) => {
    setSearch(event.target.value)
    // debouncedTrackSearch(event.target.value)
  }
  const data = []

  const columns = [
    { field: 'id', hide: true},
    {
      field: 'title',
      headerName: 'Title',
      flex: 1
    },
    { field: 'albumId', hide: true},
    { field: 'mediaTypeId', hide: true},
    { field: 'genreId', hide: true},
    { field: 'composer', hide: true},
    {
      field: 'duration',
      headerName: 'Duration',
      width: 200
    },
    {
      field: 'size',
      headerName: 'Size'
    },
    { field: 'price', hide: true}
  ]

  return (
    <Box display="flex" flexDirection="column" flexGrow={1}>
      <Box my={2}>
        <Typography variant="h3">Tracks</Typography>
      </Box>
      <Box my={2} sx={{ backgroundColor: 'white', borderRadius: '4px' }}>
        <Search
          value={search || ''}
          onChange={handleTrackSearch}
        />
      </Box>
      <Box my={2} height={500}>
        <StyledDataGrid
          columns={columns}
          rows={data}
        />
      </Box>
    </Box>
  )
}
